Entries.RequestBody:
{
  "properties": {
    "template": {
      "$schema": "http://schema.management.azure.com/schemas/2015-01-01/deploymentTemplate.json",
      "contentVersion": "1.0.0.0",
      "parameters": {
        "applicationName": {
          "type": "string",
          "metadata": {
            "description": "The application name"
          }
        },
        "clusterName": {
          "type": "string",
          "metadata": {
            "description": "Name of your cluster - Between 3 and 23 characters. Letters and numbers only"
          }
        },
        "serviceKind": {
          "type": "string",
          "defaultValue": "Stateless",
          "metadata": {
            "description": "The service kind. Stateless or Stateful"
          }
        },
        "serviceName": {
          "type": "string",
          "defaultValue": "AzureFileVolumePlugin2~Service",
          "metadata": {
            "description": "The service name"
          }
        },
        "serviceTypeName": {
          "type": "string"
        },
        "partitionScheme": {
          "type": "string",
          "defaultValue": "Singleton",
          "metadata": {
            "description": "Partition Scheme."
          }
        },
        "partitionDescription": {
          "type": "Object"
        },
        "instanceCount": {
          "type": "int"
        }
      },
      "resources": [
        {
          "apiVersion": "2017-07-01-preview",
          "type": "Microsoft.ServiceFabric/clusters/applications/services",
          "name": "[concat(parameters('clusterName'), '/', parameters('applicationName'), '/', parameters('serviceName'))]",
          "properties": {
            "serviceKind": "[parameters('serviceKind')]",
            "serviceTypeName": "[parameters('serviceTypeName')]",
            "partitionDescription": "[parameters('partitionDescription')]",
            "correlationScheme": [],
            "serviceLoadMetrics": [],
            "servicePlacementPolicies": [],
            "instanceCount": "[parameters('instanceCount')]"
          }
        }
      ]
    },
    "parameters": {
      "clusterName": {
        "value": "azurermsfclustertest"
      },
      "applicationName": {
        "value": "testApp1316"
      },
      "serviceName": {
        "value": "testApp1316~testService6547"
      },
      "serviceTypeName": {
        "value": "VotingWebType"
      },
      "partitionDescription": {
        "value": {
          "partitionScheme": "Singleton"
        }
      },
      "instanceCount": {
        "value": -1
      }
    },
    "mode": "Incremental"
  }
}

